  exportToExcel(data: any[], fileName: string): void {
    // Create a new worksheet
    const worksheet: XLSX.WorkSheet = {};
    const headers = ['Nombre', 'Contenido', 'Estado'];
    // Add headers to the worksheet
    headers.forEach((header, index) => {
      const cellAddress = { c: index, r: 0 };
      worksheet[XLSX.utils.encode_cell(cellAddress)] = { v: header, t: 's', s: { font: { bold: true } } };
    });

    // Fill the worksheet with data
    data.forEach((item, rowIndex) => {
      Object.keys(item).forEach((key, colIndex) => {
        const cellAddress = { c: colIndex, r: rowIndex + 1 }; // +1 to account for header row
        let cellValue = item[key];
        let cell: XLSX.CellObject = { v: cellValue, t: 's' };

        // Apply bold formatting if the cell value contains <strong> tags
        if (typeof cellValue === 'string' && cellValue.includes('<strong>')) {
          cellValue = cellValue.replace(/<strong>(.*?)<\/strong>/g, '$1');
          cell.v = cellValue;
          cell.s = { font: { bold: true } };
        }

        // Apply text wrapping to the "Contenido" column
        if (key === 'content_transform') {
          if (!cell.s) cell.s = {};
          cell.s.alignment = { wrapText: true };
        }

        worksheet[XLSX.utils.encode_cell(cellAddress)] = cell;
      });
    });

    // Set column widths
    worksheet['!cols'] = [
      { wch: 20 }, // Width for the first column (Nombre)
      { wch: 200 }, // Width for the second column (Contenido)
      { wch: 10 }  // Width for the third column (Estado)
    ];

    const range = { s: { c: 0, r: 0 }, e: { c: headers.length - 1, r: data.length } };
    worksheet['!ref'] = XLSX.utils.encode_range(range);

    // Create a workbook and add the worksheet
    const workbook: XLSX.WorkBook = { Sheets: { 'data': worksheet }, SheetNames: ['data'] };
    const excelBuffer: any = XLSX.write(workbook, { bookType: 'xlsx', type: 'array' });

    // Save the Excel file
    this.saveAsExcelFile(excelBuffer, fileName);
  }

  private saveAsExcelFile(buffer: any, fileName: string): void {
    const data: Blob = new Blob([buffer], { type: EXCEL_TYPE });
    saveAs(data, `${fileName}_export_${new Date().getTime()}.xlsx`);
  }




